"use strict";(self.webpackChunkkgenots=self.webpackChunkkgenots||[]).push([[1477],{10:r=>{r.exports=JSON.parse('{"blogPosts":[{"id":"blog-renewal","metadata":{"permalink":"/blog/blog-renewal","source":"@site/blog/2023-08-29-blog-renewal.md","title":"\ube14\ub85c\uadf8 \uc0c8\ub85c \uc2dc\uc791\ud558\uae30","description":"\uc7ac\ud14c\ud06c, \ubd80\ub3d9\uc0b0, \uac74\uac15 \ub4f1 \uc5ec\ub7ec \ube14\ub85c\uadf8\ub97c \uc6b4\uc601\ud558\uace0 \uc788\uc9c0\ub9cc, \uac00\uc7a5 \uc6b4\uc601\uc5d0 \uace0\ubbfc\uc774 \ub418\ub294 \ube14\ub85c\uadf8\ub294 \ud56d\uc0c1 \uac1c\ubc1c \ube14\ub85c\uadf8\uc778\uac83 \uac19\uc2b5\ub2c8\ub2e4.","date":"2023-08-29T00:00:00.000Z","formattedDate":"2023\ub144 8\uc6d4 29\uc77c","tags":[{"label":"branding","permalink":"/blog/tags/branding"}],"readingTime":1.7533333333333334,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"\ube14\ub85c\uadf8 \uc0c8\ub85c \uc2dc\uc791\ud558\uae30","description":"\uc7ac\ud14c\ud06c, \ubd80\ub3d9\uc0b0, \uac74\uac15 \ub4f1 \uc5ec\ub7ec \ube14\ub85c\uadf8\ub97c \uc6b4\uc601\ud558\uace0 \uc788\uc9c0\ub9cc, \uac00\uc7a5 \uc6b4\uc601\uc5d0 \uace0\ubbfc\uc774 \ub418\ub294 \ube14\ub85c\uadf8\ub294 \ud56d\uc0c1 \uac1c\ubc1c \ube14\ub85c\uadf8\uc778\uac83 \uac19\uc2b5\ub2c8\ub2e4.","slug":"blog-renewal","tags":["branding"],"image":"https://i.imgur.com/mErPwqL.png","hide_table_of_contents":false}},"content":"\uc7ac\ud14c\ud06c, \ubd80\ub3d9\uc0b0, \uac74\uac15 \ub4f1 \uc5ec\ub7ec \ube14\ub85c\uadf8\ub97c \uc6b4\uc601\ud558\uace0 \uc788\uc9c0\ub9cc, \uac00\uc7a5 \uc6b4\uc601\uc5d0 \uace0\ubbfc\uc774 \ub418\ub294 \ube14\ub85c\uadf8\ub294 \ud56d\uc0c1 \uac1c\ubc1c \ube14\ub85c\uadf8\uc778\uac83 \uac19\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n\x3c!--truncate--\x3e\\r\\n\\r\\n## \ube14\ub85c\uadf8 \ub9ac\ub274\uc5bc\\r\\n\\r\\n\ub2e4\ub978 \uc8fc\uc81c\uc758 \ube14\ub85c\uadf8\uc758 \uacbd\uc6b0, \uc815\ubcf4\uc131 \uae00\ub9cc \uc62c\ub9ac\ub2e4\ubcf4\ub2c8 \uc815\ud655\ub3c4\ub9cc \uc2e0\uacbd \uc4f0\uba74 \ub418\ub294 \ud3b8\uc785\ub2c8\ub2e4. \ubc18\uba74\uc5d0 \uac1c\ubc1c \ube14\ub85c\uadf8\ub294 \ud56d\uc0c1 \uafb8\uc900\ud788 \ub0b4\uac00 \ud559\uc2b5\ud558\uace0 \uacbd\ud5d8\ud574 \ubcf8 \uc9c0\uc2dd\ub4e4\uc744 \uc801\uc5b4\uc57c\ud558\ub294 \ubd80\ub2f4\uac10\uc774 \uc788\uc2b5\ub2c8\ub2e4. \uc815\ud655\ub3c4\ub97c \uc2e0\uacbd \uc4f0\ub294\ub9cc\ud07c \uafb8\uc900\ud788 \uac1c\ubc1c\ud558\uace0 \uadf8 \uc77c\ub4e4\uc744 \uae30\ub85d\ud558\ub294 \uc77c\ub4e4\uc774 \uadf8\ub9cc\ud07c \uc27d\uc9c0 \uc54a\ub2e4\ub294 \uac83\uc774\uc9c0\uc694.\\r\\n\\r\\n\\r\\n### \ube14\ub85c\uadf8... \uc600\ub358 \uac83\\r\\n\\r\\nGithub Blog, Tistory, Velog \uc774\uacf3\uc800\uacf3 \ub5a0\ub3cc\uc544\ub2e4\ub2c8\uba74\uc11c \ud3ec\uc2a4\ud305\uc744 \ud588\uc73c\ub098, \uc5b4\ub514 \ud558\ub098 \uc790\ub9ac\uc7a1\uace0 \uafb8\uc900\ud788 \uc801\uc9c0 \ubabb\ud558\uace0 \ub9cc\ub4e4\uace0 \uc9c0\uc6b0\uace0\ub97c \ubc18\ubcf5\ud588\ub358 \ud754\uc801\uc774 \ub9ce\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n<figure style={{ textAlign:\'center\' }}>\\r\\n  <img \\r\\n    src=\\"/static/blog/2023-08-29-blog-history1.webp\\"\\r\\n    alt=\\"tistory-blog\\"\\r\\n  />\\r\\n  <figcaption>Tistory \ube14\ub85c\uadf8</figcaption>\\r\\n</figure>\\r\\n\\r\\n<figure style={{ textAlign:\'center\' }}>\\r\\n  <img \\r\\n    src=\\"/static/blog/2023-08-29-blog-history2.webp\\"\\r\\n    alt=\\"github-blog\\"\\r\\n  />\\r\\n  <figcaption>Github \ube14\ub85c\uadf8...\uc600\ub358 \uac83</figcaption>\\r\\n</figure>\\r\\n\\r\\n\\r\\n## Github Pages \uc7ac\uac1c\ubc1c\\r\\n\\r\\n\uc77c\uc804\uc5d0 [Jekyll](https://jekyllrb-ko.github.io/), [Gatsby](https://www.gatsbyjs.com/) \ub4f1\ub4f1 \uc5ec\ub7ec \uc2dc\ub3c4\ub97c \ud574\ubcf4\uc558\uc73c\ub098, \ub514\uc790\uc778\ub9cc \uace0\ub974\ub2e4\uac00 \uacb0\uad6d \ud3ec\uae30\ud558\uae30\ub97c \uc218\ub3c4 \uc5c6\uc774 \ubc18\ubcf5\ud588\ub358 \uac83 \uac19\uc2b5\ub2c8\ub2e4  .\\r\\n\\r\\n[Docusaurus](https://docusaurus.io/) \ub77c\ub294 **Meta**\uc758 \ub77c\uc774\ube0c\ub7ec\ub9ac\uac00 \uc0dd\uae34 \uac83\uc744 \ud655\uc778\ud558\uace0 [Dyte Docs](https://docs.dyte.io/)\uc758 \ud15c\ud50c\ub9bf\uc744 \uc0ac\uc6a9\ud558\uae30\ub85c \ud588\uc2b5\ub2c8\ub2e4. \\r\\n\\r\\nDocusaurus\ub294 \uac1c\ubc1c \ubb38\uc11c\uc640 \ube14\ub85c\uadf8\ub97c \uac19\uc774 \uc798 \uad00\ub9ac\ud560 \uc218 \uc788\ub294 \ub77c\uc774\ube0c\ub7ec\ub9ac\uc778 \uac83 \uac19\uc2b5\ub2c8\ub2e4. \uc774\uc655 \ub9c8\uc74c\uba39\uace0 \ub2e4\uc2dc \uc2dc\uc791\ud55c \uae40\uc5d0 **\ud504\ub85c\ud544, \ud3ec\ud2b8\ud3f4\ub9ac\uc624, \uc774\ub825\uc11c, \ube14\ub85c\uadf8**\ub97c \ud55c\uaebc\ubc88\uc5d0 \ud1b5\ud569\ud574\uc57c\uaca0\ub2e4\ub294 \uc0dd\uac01\uc73c\ub85c \ub2e4\uc2dc \ub9cc\ub4e4\uace0 \uc788\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n\ube14\ub85c\uadf8\uc758 \ud575\uc2ec\uc740 \uc5ed\uc2dc\ub098 \uae00\uc778\uc9c0\ub77c \uafb8\uc900\ud568\uc774 \ub610 \ud544\uc694\ud558\uaca0\uc9c0\uc694 \u3160\u3160\\r\\n\\r\\n## \ub9c8\ubb34\ub9ac\\r\\n\\r\\n\uc544\uc9c1 \uae00 \uc19c\uc528\uac00 \uc88b\uc9c0\ub294 \ubabb\ud574\uc11c \ub9d0\ud22c\ub098 \ubb38\uc7a5\uc744 \uc801\ub294 \uc2b5\uad00\uc774 \uc88b\uc9c4 \uc54a\uc740 \uac83 \uac19\uc9c0\ub9cc, \uc774\uc655 \uac1c\uc778 \ubb38\uc11c\ub97c \ub2e4 \ubaa8\uc544 \ub193\ub294\ub2e4\uace0 \uc0dd\uac01\ud558\uace0 \uafb8\uc900\ud788 \ud574\ubd10\uc57c\uaca0\uc2b5\ub2c8\ub2e4.\\r\\n\\r\\n\uc774\uc0c1 ~~"}]}')}}]);